import React, { Component } from 'react'
import {Input} from 'antd'

export default class Profil extends Component {
    constructor(props){
        super(props)
        this.curent_user = JSON.parse(sessionStorage.getItem('sessionCurrent'))
    }
    state = {  }
    render() {
        return (
            JSON.stringify(this.curent_user)
        );
    }
}
